#include <stdio.h>

#define MAX  2000

void PrintArray(int* array, int len) {
	for (int i = 0; i < len; i++)
		printf("%d ", array[i]);
	printf("\n");
}

int Partition(int* array, int i, int j) {
	int x = array[i];
	while (i < j) {
		while (i < j && array[j] >= x) {
			j--;
		}
		if (i < j) {
			array[i] = array[j];
			i++;
		}
		while (i < j && array[i] <= x) {
			i++;
		}
		if (i < j) {
			array[j] = array[i];
			j--;
		}
	}
	array[i] = x;
	return i;
}

void QuickSort(int* array, int i, int j) {
	if (i < j) {
		int index = Partition(array, i, j);
		QuickSort(array, i, index - 1);
		QuickSort(array, index + 1, j);
	}
}

